pragma solidity ^0.5.1;

contract MyToken {
    string public name = "HarshilToken";
    string public symbol = "##**##";
    string public standard = "HarshilToken v1.0";
    uint256 public totalSupply;
    mapping(address => uint256) public balanceOf;
    mapping(address => mapping(address => uint256)) public allowance;

    // by declaring them as public we don't need to initialise a function
    constructor(uint256 _initValue) public {
        balanceOf[msg.sender] = _initValue;
        totalSupply = _initValue;
    }

    event Transfer(address indexed _from, address indexed _to, uint256 _value); // fire when the transfer function is called

    event Approval(
        address indexed _owner,
        address indexed _spender,
        uint256 _value
    );

    function transfer(address _to, uint256 _value)
        public
        returns (bool success)
    {
        require(
            balanceOf[msg.sender] >= _value,
            "Your balance is less than transfer amount"
        );
        balanceOf[msg.sender] -= _value;
        balanceOf[_to] += _value;
        emit Transfer(msg.sender, _to, _value);
        return true;
    }

    function approve(address _spender, uint256 _value)
        public
        returns (bool success)
    {
        allowance[msg.sender][_spender] = _value;
        emit Approval(msg.sender, _spender, _value);
        return true;
    }

    function HarshilToken(uint256 _initialSupply) public {
        balanceOf[msg.sender] = _initialSupply;
        totalSupply = _initialSupply;
    }

    function transferFrom(
        address _from,
        address _to,
        uint256 _value
    ) public returns (bool success) {
        require(_value <= balanceOf[_from], "asjdha");
        require(_value <= allowance[_from][msg.sender], "asdkjasdlk");
        balanceOf[_from] -= _value;
        balanceOf[_to] += _value;
        allowance[_from][msg.sender] -= _value;
        emit Transfer(_from, _to, _value);
        return true;
    }
}
